  true,\n\t\"url\": null,\n\t\"notes\": \"The Automated Surface Observing System (ASOS)
  Controller Equipment (ACE) Information Display System (ACE-IDS) is a hardware upgrade
  and software replacement to the ACE. The ACE-IDS is an integrated commercial off-the-shelf/non-developmental
  item (COTS/NDI) system that allows data from multiple internal and external sources
  to be consolidated on screen in many combinations and formats for easy access within
  a graphical user interface.  Reference data, such as charts, maps, approach plates,
  procedures, etc., can be integrated with real-time data collected by interfaces
  to other systems.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
